import React from 'react'
import styled from 'styled-components';


// style componen start

const Container =styled.div`height:60`
const Wrapper=styled.div`
padding: 10px 20px;
`

// style componen end  

const Navbar = () => {
    return (
        <Container>
           <Wrapper> Navbar</Wrapper>
        </Container>
    )
}

export default Navbar
